import React, { useState } from 'react';
import FadeIn from 'react-fade-in';
import ProjectImages from '../components/body/ProjectImages';

import './projects.css';
import { projectsData } from '../utils/projectsData';

export default function Projects() { 
    const [data] = useState(projectsData)
    const [index, setIndex] = useState(data[0])

    return (
        <div className='body-container selected-work'>
            <div className='clients-name'>
                {data.map((project, i) => (
                    <FadeIn delay={50} visible={true}>
                        <div className={i === index ? 'project active' : 'project'} >
                            <h3>{project.client}</h3>
                            <div className=''>
                                <span>{project.year}      </span>
                                <span>Role: {project.role}</span>
                            </div>
                        </div>
                    </FadeIn>
                ))}
                <div className='Project-mobile'>
                    <projectImages data={data[i]}/>
                </div>
            </div>
        </div>
    )
}
